      "name": "",
      "description": "Saisir la viande sans trop de coloration. Débarrasser.\n\nDans la même sauteuse, faire suer les oignons émincés dans l'huile, avec les épices et l'ail. \n \nAjouter la viande saisie et tous les autres ingrédients dans le flexichef. Ajouter les tiges de la coriandre (utilisée dans les finitions). Couvrir à hauteur d'eau. Cuire jusqu'à parfaite tendreté. \n\nAprès cuisson, filtrer le bouillon de cuisson (ajuster la quantité de jus avec de l'eau si nécessaire 137g/portion). Rectifier l'assaisonnement si nécessaire.\n\nDécanter la viande, l'effilocher à la krohnen puis l'assaisonner avec les ingrédients de l'étape suivante intitulé \"viande\" : tamari + jus de citron vert.",
