      "description": "Faire fondre le chocolat avec le beurre au bain marie. Torréfier rapidement noisettes et noix de pécan. A part, blanchir les jaunes avec le sucre.\nFaire mousser légèrement les blancs avec le sucre à la feuille.\nAjouter le chocolat, le beurre, puis la farine et le cacao en poudre. Ajouter le mélange jaune+sucre.\nLaisser tourner et avant de débarrasser, ajouter les noix. \nMettre en cadre (1 cadre = 18 portions)",
